import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.css';


const root = ReactDOM.createRoot(document.getElementById('root'));
//nav component
function Navbar() {
  return (
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li>Products |</li>
        <li>About |</li>
        <li>Contact</li>
      </ul>
    </nav>
  )
}

//search component
function Search() {
  return (
    <div className="searchbar">
      <input type="text" placeholder="Search" />
    </div>
  )
}

//products component
function Product() {
  return (
    <div class="products">

      <div class="box">

        <img src="./assets/images/perfume1.jpg"></img>
          <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>


      <div class="box">
        <img src="./assets/images/perfume2."></img>
          <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>
      <div class="box">
        <img src="./images/two.jpg" alt="Designs Club"></img>
          <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
      </div>



    </div>
  )
}

root.render(
  <div>
    <Navbar></Navbar>
    <Search></Search>
    <product></product>
  </div>
);
